import React from "react";
import Title from "./styles/song/title";
import SongStyles from "./styles/song/songStyles";
import Composer from "./styles/song/composer";
import Link from "next/link";

const Song = ({ song }) => {
  console.log(song);
  // const composerConcat = song.composers.join(", ");
  return (
    <SongStyles>
      <Title>
        <Link
          href={{
            pathname: "/song",
            query: { id: song.id }
          }}
        >
          <a>{song.title}</a>
        </Link>
      </Title>
    </SongStyles>
  );
};

export default Song;
